import "./App.css";
import User from "./pages/User";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

export default function App() {
  return;
  <Router>
    <Routes>
      <Route exact path="/" element={<User />} />
    </Routes>
  </Router>;
}
